export default class MxDbDatabase{constructor(t){this._mxDatabase=t}addLayer(t){return this._mxDatabase.addLayer(t)}showLayer(t,a){this._mxDatabase.showLayer(t,a)}setCurrentLayer(t){return this._mxDatabase.setCurrentLayer(t)}getLayer(t){return this._mxDatabase.getLayer(t)}addEntity(t){return this._mxDatabase.addMxEntity(t)}getGroup(t){return this._mxDatabase.getGroupDictionary().getAt(t)}addGroup(t){return this._mxDatabase.getGroupDictionary().add(t)}getEntityInGroup(t){return this._mxDatabase.getGroupDictionary().getEntityInGroup(t)}deleteGroup(t){return this._mxDatabase.getGroupDictionary().delete(t)}};